"description": "&quot;When words fail, music speaks.&quot;\r\nThis is a heavy 22 gauge copper pick modeled after an actual guitar pick (approx. 1 1/2&quot; x 1 1/8&quot;). It&#39;s stamped in our Meridian font, which you&#39;ll only find at Tag...You&#39;re It Jewelry.\r\n\r\nWe heat treat the copper to give it a unique look, but it will tarnish evenly with time like an old penny, unless you choose to polish it.  \r\n\r\nJust leave a note in the message box at checkout telling us what you&#39;d like it to say!  If your text is too long, we&#39;ll either stamp it in a smaller font, stamp it horizontally across the pick, or both.\r\n\r\nSee the rest of our designs here: http://www.etsy.com/shop/tagyoureitjewelry\r\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n\r\n-We hand stamp each and every letter individually. They won&#39;t line up perfectly, which is what\r\nhandcrafted is all about: character and uniqueness. \r\n\r\n-We do not stamp on the back of these.\r\n\r\n-Your item will be stamped in the same font as pictured, using the same letter case, unless \r\nyou&#39;ve discussed otherwise with us.\r\n\r\n-Be sure to leave the details of your order (names, text) in the memo box at checkout.\r\n\r\n\r\nThanks!\r\n\r\n©Tag...You&#39;re It Jewelry, LLC 2011 and beyond \r\n\r\n*******Current turnaround time is 1-2 weeks plus shipping.  There are upgraded options at checkout if you need it sooner.********",
