"description": "Variegated Tiger Eye - Gemstone Guitar Pick\n30.54mm x 24.37mm and 1.49mm thick\n1 inch = 25.4 mm\nA nickel is = 21.20mm\nItem# E0311\n\nVariegated Tiger Eye Tiger&#39;s eye (also called Tigers eye or Tiger eye)  comes from Cape Province, South Africa is a chatoyant gemstone that is usually a metamorphic rock that is a golden to red-brown color, with a silky luster. A member of the quartz group, it is a classic example of pseudomorphous replacement by silica of fibrous crocidolite (blue asbestos) During the process, the asbestos is completely dissolved.  But The quartz takes on the fibrous formations and the blue color of crocidolite. This creates the parallel lines within the gem which gives it that ever shifting play of light and movement, the stone is so loved for.  This is also known as chatoyancy.  This gleam that rolls across its surface is much like the eyes of a cat.  A mixture of golden and blue color is referred to as Variegated Tiger Eye. \n\nGemstone picks will last a long time. The picks have a polished edge that allows the pick to glide across the guitar strings. \n\nAll pictures taken outdoors in sunlight and dry (sometimes people take pictures with the rock wet to show what they look like polish). Color may vary some from the original, but should be close.\nAll picks are hand made by me and only me! \n\nPlease read my policies to help answer any questions you have. Contact me if you have more questions.\n\nNote: Stone picks can BREAK!\nThe main concern for your stone picks long life is dropping it on tile or concrete floors. Also do not carry the guitar picks in your wallet or loose in your pocket with your keys or coins. Don&#39;t try to flex your pick , rocks don&#39;t flex they break.",
