"sale_message": "Thanks for purchasing one/or more of Rocky&#39;s Rockin Guitar Picks.  \r\nI will ship your order ASAP by USPS first class mail with delivery confirmation if shipped within the USA.  Overseas orders by USPS first class mail WITHOUT delivery confirmation.\r\nI will send you an E-mail when I ship your package along with the delivery confirmation number.\r\n\r\nPlease see my Shop Policies for more information.\r\n\r\nHave a great DAY !\r\nJay",
