"accepts_custom_requests": true,
"policy_welcome": "Hi to all,\r\nAll of these picks are made by me in my shop.  I put all my love for gemstones into these Gemstone Guitar Picks.  I believe you will find these picks a new way to enjoy playing your string instruments.  The sound and action is completely different then with a plastic pick.  Please enjoy viewing my stone picks.\r\nThank You for visiting my site. \r\nJay",
"policy_payment": "Credit Card\r\nPayPal \r\nOnly  Credit Card and PayPal for International customers.\r\nCheck and Money Order from USA only.  Must clear before Shipping Item. ",
