"description": "Complete with a hand sawed heart for dad, this bronze guitar pick was cut from 20 gauge bronze and stamped one letter at a time with couldn&#39;t pick a better dad. You can personalize this pick for dad with any additional stamping, custom message, or exchange the heart for a different cut out by entering your requests in the notes to seller section during check out.\n\nThis bronze pick has hand filed edges and polished surfaces for a smooth glide and is ready to help dad master that tricky power slide for a little guitar voodoo. Measuring 1.3 inches long by 1.2 inches wide, the pick is my own unique design, but is similar in size to a standard plastic pick. Bronze and metal guitar picks offer a brighter tone and longer sustain versus plastic picks, while providing excellent rigidity and aesthetics. The text is darkened with a black patina for contrast and legibility against the golden glow of burnished bronze.\n\nCustom orders and special requests are always welcome. Since I make my own blank guitar picks, I can create picks in any shape, size, style, thickness and metal with your choice of designs. Guitar picks also make great bracelets and pendants. Please contact me any time with questions. Thanks.. Nici",
