"title": "Nici&#39;s Guitar Picks Jewelry and Accessories",
"announcement": "Nicilaskins&#39; Shop Announcements\r\n\r\nHandmade with attention to detail and quality, Nici Laskin passionately crafts custom guitar picks, tie bars, cuff links, mens&#39; accessories, bracelets, pendants, earrings, necklaces, money clips, golf markers, high quality stamping blanks, wedding bands, and much more in a variety of metals including sterling silver, gold, aluminum, bronze, brass, and copper. We strive not only to bring you the highest quality artistic work available, but also personal attentive service with guaranteed satisfaction and are always available to answer questions and discuss custom designs. Please don&#39;t hesitate to contact us at any time or give us a call at 575.737.8521.\r\n\r\nGiven the handmade time consuming nature of our work, orders generally ship within 7-10 days of placing your order. \r\n\r\nWe use the thickest metals with certified purity from reputable US Vendors, so our stamping is always clean and precise without bending, marring, denting, and punching through the back, therefore we can gladly stamp both sides of jewelry with symbols and personalized messages. Not only do we produce our own stamping blanks, but we are also a supplier of the highest quality blanks on Etsy. If you don&#39;t see exactly what you would like in my shop, no worries, we always welcome your custom and personalized orders whether you are looking for that unique wedding ring, graduation gift, something special for a birthday, anniversary or a gift for someone who is impossible to please. \r\n\r\n\r\nYou can also follow and like us on Facebook:\r\nwww.facebook.com/NiciArt\r\n\r\nCheck out my custom guitar picks in action\r\nhttp://www.youtube.com/watch?v=YYGanv5YULw\r\n\r\nThanks for visiting,\r\nNici and RJ\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "I am on Vacation at the moment\r\n",
"sale_message": "My current turn around time is 7-14 days... Feel free to call us at 575.737.8521 to check order status or with questions regarding your order. We can accommodate some rushed orders please call or write an email to ask.\r\n**********************\r\nEvery item in my shop nicilaskin.etsy.com is made from scratch and by my hands . Time until this item is made and ready to ship may vary , please expect a production time of 10-14 business days ( 2 weeks ) at this time . For a more accurate time line please read my shop announcement or my shipping policies http://www.etsy.com/shop/NiciLaskin/policy?ref=shopinfo_policies_le\r\n\r\nThanks for your patience and understanding... Nici\r\n\r\n\r\nonce again thanks so much.\r\n\r\ncooper and bronze tend to tarnish , sometimes if you live in a coastel region that can happen very fast , now i personally happen to like the aged look of copper and bronze , but in the case you do not , here are little tips to keep copper and bronze clean\r\n\r\nhow to clean bronze : Pour a tablespoon of baking soda into a small dish and squeeze some lemon juice over it. The pasty mixture will bubble, but will quickly settle down.\r\nUse a small piece of soft cloth to rub this paste onto your bronze piece. Rub until you&#39;re satisfied with the clean\r\n\r\n\r\nhow to clean copper : rub down with ketchup until sparkling clean and rinse with water , dry with soft cloth, not quite working? try mixing a bit of salt into the ketchup ( old cooking trick for copper pans and pots )\r\n\r\n\r\ni can also seal your pick with lacquer however you should not play your guitar with a sealed pick as the lacquer will get on the strings \r\n\r\nnici\r\n\r\nInternational buyers are responsible for all VAT, fees, and custom restrictions. Please do not purchase something that is prohibited from import on the receiver&#39;s end. Full value of the item will be declared on the customs form. Once shipped I have no control over delays or confiscation at customs.\r\n\r\n",
