"login_name": "nicilaskin",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to my little shop here on Etsy. Please don&#39;t hesitate to contact us at any time or give us a call at 575.737.8521 with any questions or to discuss custom orders. \r\n\r\nMy turn around time is listed as 2 weeks, since I make custom wedding rings, sterling silver bracelets with stones, belts, mens accessories and other very time consuming pieces. If you happened to forget an anniversary, birthday, or just stumbled across my site while looking for that perfect gift that needs to arrive the next, no worries. I am always willing to work with you get those last minute items out, but please do contact me right. Thanks for stopping by.. Nici\r\n",
"policy_payment": "Paypal and direct check out are always easiest and greatly appreciated, but I will also accept cashiers checks, money orders, and personal checks for small orders less than $100.00.\r\n\r\nHowever the items will only be shipped after i received the MO or Checks and they cleared in my bank.",
"policy_shipping": "All shipments are made with UPS or the USPS and take usually 2-5 business days (FIRST CLASS WITH DELIVERY CONFIRMATION )and are trackable and insured. A tracking number will be emailed upon shipment. I am willing to ship anywhere world wide and will work with you to find the cheapest, fastest, and best method for shipping.\r\nHowever there is not a guaranteed time frame on international shipping as it depends on customs of the country you are coming from.\r\n\r\n\r\nInternational buyers are responsible for all VAT, fees, and custom restrictions. Please do not purchase something that is prohibited from import on the receiver&#39;s end. Full value of the item will be declared on the customs form. Once shipped I have no control over delays or confiscation at customs.\r\n\r\n* Please note that I will follow all applicable United States laws relative to trade restrictions, sanctions, and embargoes. At this time shipment is prohibited to Iran, Syria, North Korea, Cuba, and Libya.\r\n\r\n\r\nPLEASE MAKE SURE TO DOUBLE CHECK YOUR ADDRESS ,AS WRONG ADDRESSES CAN RESULT IN A LONG DELAY AND ADDITIONAL SHIPPING COSTS ",
"policy_refunds": "Refunds are acceptable for items paid for with paypal for up to 7 days after receipt of item back to me. Claims for damages and losses will be made with the postal service or carrier.\r\nHowever there is no refunds on Custom Orders.\r\n\r\nIf you have problems with a fit, do not hesitate to contact me i can resize at no additional cost to you.\r\n\r\nInternational buyers are responsible for all VAT, fees, and custom restrictions. Please do not purchase something that is prohibited from import on the receiver&#39;s end. Full value of the item will be declared on the customs form. Once shipped I have no control over delays or confiscation at customs.\r\n\r\n* Please note that I will follow all applicable United States laws relative to trade restrictions, sanctions, and embargoes. At this time shipment is prohibited to Iran, Syria, North Korea, Cuba, and Libya.",
