"description": "Current Production time is 14 days plus shipping time! \r\nINTERNATIONAL ORDERS, please READ OUR SHIPPING POLICIES BELOW BEFORE ORDERING! International shipping can take anywhere from 2 - 6 weeks depending on your countries customs speed. WE CAN NOT GUARENTEE DELIVEY TIMES FOR INTERNATIONAL ORDERS.\r\nWe can not stamp on the back of ANY ITEMS it will ruin the look of the front! \r\n\r\n Custom Guitar Pick and leather keychain Holder.\r\nCustomize this pick however you want or choose the saying pictured above.\r\n\r\nThis listing is for one 1&quot;x1 1/4&quot; playable Guitar Pick, 22g Stainless Steel (Mirror finished) Guitar Pick and Leather Key chain Holder!\r\n\r\nStainless steel is an excellent choice for producing quality jewelry. It is hypo allergenic, does not rust, change color or tarnish. And because it is so durable, items crafted with it can be treasured for a lifetime.\r\n\r\nWhen checking out please include Choice of saying If your not sure if it will fit please convo us! **\r\n\r\n!!!!!!!!!!!!!!!!!!!!!!!!! (If No choice Is listed we will default to product shown)!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n\r\n●▬▬▬▬▬♥ IMPORTANT READ BELOW BEFORE ORDERING ♥▬▬▬▬▬●\r\n\r\n\r\n\r\nThe piece pictured is a representation of what your piece will look like. Each letter and design is individually stamped by hand, and as such every piece I make is slightly different. This includes the spacing and depth of each stamp. The metal itself may have small swirls and lines in it also adding to charm of these pieces. This does not make your item imperfect, but rather lends to it&#39;s unique, handmade nature, and ensures that your piece is one of a kind.\r\n\r\n\r\n\r\nWe ship within 14 days of order placed. We use First Class Shipping usually (2-5) days in the continental US, unless otherwise requested, in which there will be an additional charge. The USPS does not guarentee delivery times. Once a pckage has been shipped the time frame is out of our control. You will receive tracking information so that you can monitor their progress.\r\n\r\n We ship to the address that you the buyer provide us with. We are not responsible for wrong addresses, or any forwarding to a different location by the Post Office.\r\n\r\n We are not responsible for items after they have reach your door step!\r\n\r\n HOLIDAY SHIPPING: \r\n For holiday shipping times and to ensure your order is placed in time, please see the following for USPS shipping dates: \r\n https://www.usps.com/shippingdates/\r\n\r\n INTERNATIONAL ORDERS (Including Canada): \r\n Please note that:\r\n\r\n - You are responsible for any duties and taxes within your country (including VAT for Europe, particularly UK)\r\n - Please check with your country&#39;s customs office to determine what these additional costs will be prior to buying.\r\n - Customs fees are normally charged by the shipping company or collected when you pick the item up. These fees are NOT ADDITIONAL SHIPPING CHARGES.\r\n Any order going outside of the states can take up to 6 weeks to arrive. So please do not ask where your order is until then. Please plan accordingly when placing your order. Also note that the only shipping trackable outside of the US is Express Shipping. If you would like your order sooner or would like to track it the entire way, please see our upgrades section for additional shipping options. \r\nBy placing an order, you affirm that you&#39;ve read my shop POLICIES, which contain information about shipping, returns and other facts you may find useful. \r\nhttps://www.etsy.com/shop/StampedWithPassion/policy?ref=shopinfo_policies_leftnav\r\n\r\n\r\n**************************************************************************************\r\n\r\nWe would also be happy to work with you on custom ideas or special designs, just send us a convo....\r\n\r\nThank you for stopping by our shop, please come again, as we will be adding new items soon.\r\nTake a look at some of our other items in our shop at:\r\n\r\nhttps://www.etsy.com/shop/StampedWithPassion?ref=si_shop",
