"login_name": "Synthrotek",
"accepts_custom_requests": false,
"policy_welcome": "Synthrotek is a small company based out of Portland, OR, devoted to bringing unique and interesting circuits to the world.   We are constantly developing and perfecting our circuits to take audio synthesis to a new level while keeping it affordable for the DIY musician.  Whether you want to feel the satisfaction of soldering your own circuits or creating your own signature sound, we’re here to make it a reality.\r\n\r\n \r\n\r\nWhile our time is not unlimited, we take time to help our customers achieve their goals, whether that is troubleshooting one of our electronic kits or answering technical questions.  We consider ourselves a part of the electronic music community and we always remember our first solder joints.  There are few feelings like hearing your very own handmade synth making that sweet noise.  International shipping is no problem for us.  Bulk orders are welcome.  We love our customers, so drop us an email or give us a call!\r\n\r\n \r\n\r\nWe are dedicated to producing audio electronics with the highest quality and lowest price.  All of our finished products are assembled in the US, and our circuit boards are designed in-house.   Our products are made with the DIYer in mind and the musician at heart.  You’ll have no problem assembling our circuits and you’ll love the way our products sound.",
"policy_payment": "We accept payment via credit/debit card and Paypal.",
"policy_shipping": "We ship all kits and PCBs within 1 business day of purchase.  (So if you order on Tuesday, we&#39;ll ship it by Wednesday; if you order it on Friday, we&#39;ll ship it by Monday.)  Completed units will ship within 5 business days of purchase.",
"policy_refunds": "We take returns on all undamaged completed units.  Kits and PCBs can also be returned, but ONLY if they are not soldered/built.  \r\n\r\n\r\nKits:\r\n\r\nIf you are missing a component from your kit, please email us immediately. Our kits are handpicked and errors, although rare, can occur (we&#39;re only human). We&#39;ll send you out what you need and we&#39;ll make sure to hook you up. \r\n\r\n\r\nIf you are having any difficulty building your kit, or if you have any questions, feel free to call us or email us.  If we can&#39;t figure it out with you over the phone, you can mail us your kit.  Send it to us here:\r\n\r\n\r\nSynthrotek\r\nAttn: Repair\r\n1828 SE 111th Ave\r\nPortland, OR 97216\r\n\r\n\r\nBe sure to contact us before you send it in.  Put a note in the package with your name and your order number and what&#39;s wrong.  \r\n\r\n\r\nWe will take a look at your kit for free for 30 minutes; if we can&#39;t figure it out that quickly, we&#39;ll email you with a quote on fixing it.  Our shop bills $30 an hour for repair.  Please note that you will need to pay for shipping your kit back to us AND for us to ship the kit back to you.\r\n\r\n\r\n\r\nCompleted units:\r\n\r\nIf you have a manufacturer&#39;s defect on your completed unit, we will fix it within 1 year of purchase.  That&#39;s right, 1 YEAR.  It&#39;s our no-lemon guarantee.  In this situation, we will send you a shipping label, repair the unit, and send it back free of charge.  Just contact us and let us know what&#39;s wrong.",
