"title": "Hand crafted playable miniature 6 string guitar",
"description": "I started this project with the idea that if someone out there had a very young, or very small middle school aged child that had some interest in learning to play and was struggling with a larger full or parlor sized guitar, that this would be a cool alternative. It is also more accommodating to have a ukulele sized instrument if you travel and wanted to take a guitar with you, but did not have the room for a regular sized one. \r\n\r\nIt is made from solid, one-piece body and neck construction with matching walnut back. The endgrain view around the sides of the instrument resembles burl somewhat in places due to the angle of the cuts. The top is Spanish cedar with hand carved walnut bridge in the shape of an eagle, sporting aged bridge pins and modified compensated saddle that looks like it is being grasped in the talons. The fret board is inlaid into the top.The headstock is laminated with persimmon to match the fret board. I also included a side view, hopefully it can be enlarged to show the action height. This is built on a ukulele frame with a standard 13 and 7/8&quot; scale and strung with light Extra Slinky Ernie Ball strings for acoustic guitars. No strap buttons have been installed, but could be for another $10 (the cost of chrome buttons). \r\n\r\nHear this instrument played here: (http://youtu.be/wy0cptBCJtY)\r\n\r\nGot questions about this item, send me a message. Custom orders are welcome. If you would like to see a instrument made for you with your favorite thing cut out for sound holes, or like some other kind or color of wood, no problem. You should, however, expect a minimum of two to three weeks for your custom instrument to be completed.   \r\n\r\nLive locally and wish to save on shipping, message me and hand delivery can be arranged. Each item is unique in its own regard and since I do not make things from a template, no two will be alike.  \r\n\r\nI have several other heirloom quality one of a kind toys and gifts for sale, so please check out my other items, visit my facebook page (https://www.facebook.com/EdwardsToysandGifts) or my website (http://www.edwardstoysandgifts.com/)! You are sure to find something for your own inner child or one you know. New items added as completed, but items that have sold out or are no longer in stock can be viewed there and give you ideas for a request. For something special, contact me via message. My products feature hardwoods felled and harvested from Middle Tennessee that have been sawn locally by small lumber mills and most products are accented with exotic species from around the world.\r\n\r\nSome of my photos were taken by Curtis Beard, local photographer, check out his Facebook page here:\r\n(https://www.facebook.com/curtis.beard.37?fref=ts)",
