"description": "This is a custom built mandolin with cherry backs and sides and top. The fret board is wenge on a maple riser set up for fast action down the entire length of the instrument. The bridge, of course is height adjustable and  floats in front of a black tailpiece with scroll work inscribed. I have drawn on some embossed scrolls onto the body of the instrument in brown to complement the natural warm tone of the wood. The outer sections of the tree were positioned near the center of the soundboard to assit in the transfer of vibrations from the edges of the instrument to the center, where they can be released through the soundhole. It is signed inside and inscribed, &quot;May your grass always be blue . . .&quot; It is a unique one of a kind piece. \r\n\r\nBeyond the wood, this piece sports 15:1 ratio open geared machine heads with ivoroid knobs, medium nickel frets, and black strap buttons.  \r\n\r\nGot questions about this item, send me a message. Want to see pictures of it &quot;in traction&quot; as it was being built, I have a few. Custom orders are welcome. If you would like to see an instrument made for you with your favorite thing cut out for sound holes, or like cedar or some other kind or color of wood, no problem. You should, however, expect a minimum of two to three weeks for your custom instrument to be completed. \r\n\r\nLive locally and wish to save on shipping, message me and hand delivery can be arranged. Each item is unique in its own regard and since I do not make things from a template, no two will be exactly alike.  \r\n\r\nI have several other heirloom quality one of a kind toys and gifts for sale, so please check out my other items, visit my facebook page (https://www.facebook.com/EdwardsToysandGifts) or my website (http://www.edwardstoysandgifts.com/)! You are sure to find something for your own inner child or one you know. New items added as completed, but items that have sold out or are no longer in stock can be viewed there and give you ideas for a request. For something special, contact me via message. My products feature hardwoods felled and harvested from Middle Tennessee that have been sawn locally by small lumber mills and most products are accented with exotic species from around the world.",
