"title": "Hand crafted 6 string cigar box guitar",
"description": "This is a &quot;ACID&quot; cigar box, ultimately square and almost cubicle. I inlaid an inset cut for the saddle and filed away relief for the strings to set. The neck is milled from mahogany and the fret board is made from poplar, then died to appear ebony. It hosts medium nickel frets and ends at a cherry nut leading to Grover 1:1 ukulele pegs. The strings are &quot;bridged through a custom designed poplar end-piece that I also milled a cap for so I could cover the string holes. You can see it removed in one of the pics (number 2). I string these with nylon as metal strings apply simply too much down force on most cigar boxes in my opinion and they will stay in tune better. The neck of it does not continue across the top, thus it can be opened, just not while is is strung up. I did not drill a hole in the body of the box, but doing so would increase its volume. You can ask me to drill a hole when you order if you prefer it to be louder when played. \r\n\r\nThese things are cool, and they are an interesting conversation starter, but up front, this are not intended to be instrument replacements. While you could and should play one, because they can be tuned, if you set it on a shelf for a couple weeks and come back to it, you will need to tune it again. The Grover uke pegs are 1:1 (not geared) so they work best if the string wraps around the left side of the peg if you are looking at the top of the headstock. The tuners are set with screws behind the instrument, you get it to where you want it and then tighten the screw. Tension on the shaft from the string, when it is pulling on it in the direction that the screw is turned to tighten it helps the instrument to stay in tune longer. Tension the other way will result in the tension working against the stability of the screw which hold the guitar in tune.  \r\n\r\nGot questions about this item, send me a message. Custom orders are welcome. If you would like to see a instrument made for you with your favorite thing cut out for sound holes, or like some other kind or color of wood, no problem. You should, however, expect a minimum of two to three weeks for your custom instrument to be completed.   \r\n\r\nLive locally and wish to save on shipping, message me and hand delivery can be arranged. Each item is unique in its own regard and since I do not make things from a template, no two will be alike.  \r\n\r\nI have several other heirloom quality one of a kind toys and gifts for sale, so please check out my other items, visit my facebook page (https://www.facebook.com/EdwardsToysandGifts) or my website (http://www.edwardstoysandgifts.com/)! You are sure to find something for your own inner child or one you know. New items added as completed, but items that have sold out or are no longer in stock can be viewed there and give you ideas for a request. For something special, contact me via message. My products feature hardwoods felled and harvested from Middle Tennessee that have been sawn locally by small lumber mills and most products are accented with exotic species from around the world.\r\n\r\nSome of my photos were taken by Curtis Beard, local photographer, check out his Facebook page here:\r\n(https://www.facebook.com/curtis.beard.37?fref=ts)",
