"description": "Such an adorable set for this St. Patrick&#39;s Day - or all year round for the Irish :).\r\n\r\nYou will receive this design in the following sizes\r\n\r\nROCK: 2&quot;, 3&quot;, & 4&quot;\r\n\r\nSham: 2&quot;,3&quot;, 4&quot;\r\n\r\nShamRock Guitar: 4&quot;, 5&quot;, 6&quot;, & 7&quot;\r\n\r\nStitch count based on the guitar\r\n\r\n4&quot;\r\n3.3&quot; x 3.8&quot;\r\nsc - 4020\r\n\r\n5&quot;\r\n4.2&quot; x 4.8&quot;\r\nsc - 5495\r\n\r\n6&quot;\r\n5.1&quot; x 5.8&quot;\r\nsc - 6744\r\n\r\n7&quot;\r\n6.0&quot; x 6.9&quot;\r\nsc - 8547\r\n\r\nThis design has 8 color changes\r\n\r\nAvailable in the following formats: \r\nPES - VP3 - HUS - JEF - DST - TAP - VIP - EXP - SHV - XXX. These are a few of the most popular formats. If you are unsure of the file type needed, or do not see the type for your machine listed please contact me BEFORE purchasing your items. Please leave the format you will need in the comment section when checking out. If no format is specified you will receive PES.\r\n\r\n***SIZES ARE APPROXIMATE***** There may be a slight difference in size between the letters. Lowercase letters are proportionate to uppercase letters. Single Designs are sized to fit within a certain hoop size indicated in the description of the item.\r\n\r\nShipping is free via email. Please email me the format needed for your machine at the time of your order. Again, if no format is specified you will receive PES. I will email your order within 24 hours of the time your payment has cleared. If you do not see an email from me - please check you Spam or Junk mail folder.\r\n\r\nPlease note – these are digitized embroidery designs and monogram fonts. They are NOT patches that you sew on. You must have an embroidery machine to work with these files and a way to transfer the files from your computer to your embroidery machine - (usb, memory card, box, etc.). With the monogram alphabets/fonts each letter is a separate design and you must layer or merge the designs together to create names or words. If the software that you are working with doesn’t allow you to edit, resize, or merge designs together – you may need additional software to utilize these sets.\r\n\r\nDesigns are copyrighted by Embroitique.com. You may stitch these designs out on items for resale, but may not copy, trade, share, or alter the design itself. Hours of hard work and time has been put into these designs. Please respect our work. If you have any questions about this – please ask.\r\n\r\n**WE DO CREATE DESIGNS FOR YOU UPON REQUEST, PLEASE VISIT OUR SHOP AND VIEW OUR PERSONALIZED DIGITAL MONOGRAMS**",
