"title": "Affordable High Quality Digital Embroidery Designs",
"announcement": "\r\n\r\nIt is our goal to bring a chic and innovative new edge to the embroidery world.  We also strive to present you the ability to purchase designs at an affordable price without sacrificing quality.\r\n\r\nWe are happy to announce that your Etsy order will be emailed within a minute or so after we receive payment.  Please make sure that the email address in your Etsy profile is up to date!.  Having said that, welcome to Embroitique.com on Etsy!  We have been selling high quality embroidery designs since 2006, but started actively selling our collection in this shop in September 2010.  It has been an amazing ride, and we are proud to be in the top 40 list of sellers of handmade items several years in a row!  Thank you for all of your support.  We love to see our &quot;work in action&quot; and encourage our customers to share their crafty creations.  We often feature our favorites on our blog, newsletters, facebook, and our main site Embroitique.com.\r\n\r\nOur design selection on Etsy is just a sampling of what you will find on our main website.  If you would like to see more of our designs - please visit us at www.embroitique.com or Convo us with questions you may have. \r\n\r\nWe are on Facebook!  &quot;Like&quot; our page to stay up to date with all of our new designs and special offers: https://www.facebook.com/pages/Embroitique/151238651560912\r\n\r\nAll of our designs are protected by strict copyright law.  You may stitch these designs out on items for resale, but may not tamper, trade, copy or resell the actual digitized files themselves.  We work hard to provide unbeatable quality and variety...please respect our work.\r\n\r\n",
"currency_code": "USD",
