"sale_message": "Your order will be emailed to the email address associated with your etsy profile.  You will receive an email with the designs that you ordered within a minute or so of making your payment.  If you don&#39;t see the email from us...check your spam folder!\r\n\r\nThank you for your purchase from Embroitique!\r\n\r\nWe would like to invite you to visit www.Embroitique.com for a full selection of our embroidery designs and sewing patterns...all available for INSTANT DOWNLOAD!\r\n\r\nWe are on Facebook!  &quot;Like&quot; our page to stay up to date with all of our new designs and special offers:\r\nhttps://www.facebook.com/pages/Embroitique/151238651560912\r\n\r\nThank you again for your purchase. We look forward to working with you again soon!\r\n\r\nEmbroitique&#39;s Etsy Team\r\n\r\nPlease Note: If you requested VP3 it may take a little longer for us to get your files emailed.  While most of our designs have been converted to vp3 - some of them have not.  If the set you ordered needs the update, we will get the designs to you as soon as wel can.  Thanks!!",
"digital_sale_message": "Your order will be emailed to the email address associated with your etsy profile.  You will receive an email with the designs that you ordered within a minute or so of making your payment.  If you don&#39;t see the email from us...check your spam folder!\r\n\r\nThank you for your purchase from Embroitique!\r\n\r\nWe would like to invite you to visit www.Embroitique.com for a full selection of our embroidery designs and sewing patterns...all available for INSTANT DOWNLOAD!\r\n\r\nWe are on Facebook!  &quot;Like&quot; our page to stay up to date with all of our new designs and special offers:\r\nhttps://www.facebook.com/pages/Embroitique/151238651560912\r\n\r\nThank you again for your purchase. We look forward to working with you again soon!\r\n\r\nEmbroitique&#39;s Etsy Team\r\n\r\nPlease Note: If you requested VP3 it may take a little longer for us to get your files emailed.  While most of our designs have been converted to vp3 - some of them have not.  If the set you ordered needs the update, we will get the designs to you as soon as wel can.  Thanks!!",
