"announcement": "☞ IMPORTANT THINGS TO NOTE:\r\n❤ ✶ CURRENT TURNAROUND is 7-10 BUSINESS DAYS✶ with the exception of stacking birthstone rings which are 2-3 WEEKS and our custom handwriting and artwork pieces which can take up to FOUR WEEKS prior to shipping your piece.   Please keep in mind that each item is HAND MADE. No machinery is involved.  This DOES NOT include shipping time from me to you. I ship via USPS first class mail, which the US Postal Service lists as a 5-7 business days delivery service. If you would like to upgrade your shipping method, please message me to discuss rates. International orders are shipped via first class international mail and may take up to 6 weeks to arrive and clear customs in your country. \r\n❤ I work as quickly as possible to fill orders based on the order in which they are received. If you need your item sooner, please contact me prior to placing it. In some instances, a ❧ RUSH FEE of $30 ❧ will be assessed in order to complete your request. \r\n❤ Please be advised that VAT taxes/duties and customs fees assessed by your receiving country are NOT the responsibility of Three Little Pixies. Each country&#39;s laws/requirements will vary and it is up to the buyer to be familiar with their home countries procedures. Three Little Pixies will not be refunding fees assessed by your home country upon receipt of your package so please familiarize yourself with your home countries procedures prior to placing your order. \r\n\r\n~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~\r\n\r\n❤ Production Occurs Monday - Friday outside of our busiest holiday seasons. Please be aware that there may be a delay in answering messages sent on Saturdays and Sundays as that time is reserved for my family.\r\n\r\n~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~\r\n\r\n❤ Need a printable gift card?\r\nhttps://img0.etsystatic.com/054/0/6279136/il_fullxfull.700015282_qh09.jpg\r\n\r\nhttps://img1.etsystatic.com/047/0/6279136/il_fullxfull.700138629_73vm.jpg\r\n\r\n~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~\r\n\r\n❤ Find our ♥:{ Shop Policies}:♥ here. Please familiarize yourself with them PRIOR to making your purchase:\r\nhttps://www.etsy.com/shop/3LittlePixiesShoppe/policy?ref=shopinfo_policies_leftnav\r\n\r\n~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~\r\n\r\n❤ I love custom orders!  Know of something you want but don&#39;t see it? Just convo me and I&#39;ll see what I can do!\r\n\r\n~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~\r\n\r\n❤ Currently Working on Orders from 3/9 and forward unless I have contacted you to get clarification on your purchase.\r\nxo\r\nLiz\r\n\r\n~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~\r\n\r\n❤ Don&#39;t forget to follow us on Instagram\r\nhttps://instagram.com/3_littlepixies/\r\nand Facebook\r\nwww.facebook.com/ThreeLittlePixiesBoutique \r\nfor exclusive offers, sales and coupon codes only available to our followers!\r\n\r\n~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~\r\n©2010-2015 Three Little Pixies, LLC * All designs, photos and descriptions are copyright protected by TLP, LLC and cannot be used without express written consent and permission. ",
