"sale_message": "Thank you for purchasing one of my handmade items! Each and every item from Three Little Pixies is made with love and personalized by *me* for *you!*  It is a privilege to create your custom, one-of-a-kind, keepsake piece. \r\n\r\nEtsy can be a little tricky to navigate and each shop here is independently owned, so I would like to confirm a few important details about my shop with you. \r\n\r\n❤ My current production time is up to ❤ 7-10 BUSINESS DAYS ❤ with the exception of our stacking birthstone rings which are 2-3 WEEKS and our custom handwriting and artwork pieces which can take up to FOUR WEEKS. This is the time that I devote to creating your special keepsake. Please keep in mind that each item is HAND MADE. No machinery is involved. I do strive to get your special item to you sooner but feel it necessary to say it may take up to the full TEN BUSINESS DAYS to complete your item especially during busy holiday seasons. \r\n\r\n❤ This does not include shipping time from me to you. I ship via USPS first class mail, which the US Postal Service lists as a 5-7 business days delivery service. If you would like to upgrade your shipping method, please message me to discuss rates. International orders are shipped via first class international mail and may take up to 6 weeks to arrive and clear customs in your country. \r\n\r\n❤ I work as quickly as possible to fill orders based on the order in which they are received. If you need your item sooner, please contact me prior to placing it. In some instances, a ❧ RUSH FEE of $30 ❧ will be assessed in order to complete your request. \r\n\r\n❤ Need a printable gift card?\r\nhttps://img0.etsystatic.com/054/0/6279136/il_fullxfull.700015282_qh09.jpg\r\n\r\nhttps://img1.etsystatic.com/047/0/6279136/il_fullxfull.700138629_73vm.jpg\r\n\r\n\r\n❤ Please be advised that VAT taxes/duties and customs fees assessed by your receiving country are NOT the responsibility of Three Little Pixies. Each country&#39;s laws/requirements will vary and it is up to the buyer to be familiar with their home countries procedures. Three Little Pixies will not be refunding fees assessed by your home country upon receipt of your package so please familiarize yourself with your home countries procedures prior to placing your order. \r\n\r\n❤ Please be sure to you check your Etsy account on a regular basis. Due to volume, I am unable to review your personalization details prior to beginning your order. If I need to discuss the details of your order with you, I will send you a message via Etsy. I will keep all communication within Etsy, and request that you do that same. This helps ensure order accuracy, and I appreciate your assistance! Messages on Etsy will generate an email but that email may end up in your spam folder so please be sure to check there as well. \r\n\r\n❤ The address you provided during checkout is the address your order will ship to. I will update the status of your order to &#39;shipped&#39; once it is complete. An email containing your package&#39;s label information will be sent once I have printed your postage. Please keep in mind that delivery confirmation is not tracking. The post office is only required to scan packages upon acceptance and delivery. Scans frequently occur at sort facilities along the way but this is not a requirement of the postal service. \r\n\r\n❤ You can find all the details of your transaction under your account purchases. Your invoice contains information regarding turnaround time as well as the estimated ship date of your item.  \r\n\r\n❤ Gift cards are available. If you&#39;d like to send a note with your item please contact me and let me know! I&#39;m happy to enclose one at no additional cost to you. \r\n\r\nI&#39;m looking forward to creating a one of a kind item for you to enjoy for years to come!  Unless otherwise requested, no printable receipt will be included with your purchase. Lots of our items are purchased as gifts and shipped directly to the recipient (plus we love trees as much as the next guy and try to save them when we can!) so to cut down on unwanted &quot;surprises,&quot; receipt information will be left out of your shipment. \r\n            \r\nShould you have any questions feel free to send me a message. I&#39;m here to help and want to make your buying experience as easy and pleasurable as possible. Thank you for shopping with Three Little Pixies and purchasing handmade in the U.S.A. Your support of small business is greatly appreciated. I appreciate your business and hope to see you back soon!\r\n\r\nxo\r\nLiz ❤",
