"title": "Anniversary Gifts for Men, Boyfriend Gift, Father&#39;s Day",
"announcement": "HOW TO PLACE A CUSTOM ORDER:\r\n If you decide to order, please place the order and then say in the &quot;note to giftforbestfriends&quot; box, before check out, the exact personalization you wish. Please be sure that you have give me all specification that I need to complete your order. \r\n\r\nThe processing time for your order it&#39;s 1-3 working days!!!\r\n\r\nThank you! Best wishes, Manuela",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "PLEASE READ:\r\n\r\nHi, \r\n\r\nYou are my new customer! \r\nI thank you very much for your order and I appreciate your wish to become my customer.\r\n\r\n***My current production time is 1-3 working days before shipping!*** \r\n\r\nso your order will be custom-made and sent in 3 business days. \r\n\r\nYou  TRACKING NUMBER will be loaded (after your order will be send) in  your Etsy and Pay Pal order details (for US, a check it on USPS.com tracking number, and for other countries, that country&#39;s national post tracking number). PLEASE DON&#39;T FORGET TO CHECK YOUR TRACKING NUMBER PERIODICALLY AFTER FEW DAYS!!! You will receive 2 emails, one from Etsy and one from Pay Pal. Orders are sent from Romania, so it will take some time to arrive. For the US, transit time is usually about 9-12 days to the East Coast and 14-16 days to the West Coast. For Canada it&#39;s usually about 8-12 days. For Australia, about 14-25 days. For the UK and other EU countries, anywhere between 4 to 12 days. \r\nTracking numbers are not accepted in Australia Post, PostNL and Royal Mail tracking system.\r\n\r\nYour order will arrive in an international registered letter, with signature (not in a package); this allows you to avoid paying any customs duty or other fees. It is safe (always check your tracking number) and less expensive (as you see, $3 for an international shipping, regardless of the quantity). \r\nThe terms of delivery are the usual terms, but also, because the shipping it&#39;s made only trough nationals postal services also delays may occur. This delays may happen also during the holidays season because the postal services are overloaded.\r\n I know the terms of delivery when your national postal service work fine without  unexpected delays. I can&#39;t prevent or predict some delays and the postal services actions are not under my control. \r\n\r\nIf you have any questions please let me know, and I&#39;ll be happy to help. \r\nYou should expect a response within 1 - 2 working days because I&#39;m  located in a different time zone and I may need additional time to respond to your question.\r\n\r\nREVIEW!\r\nDo you like my work? Then please write me a nice review :)  But negative feedbacks makes me sad, therefore if there is any problem or a mistake (which I assure you that was not made intentional) even if they occur very rarely, PLEASE CONTACT ME before making the decision to send a negative feedback and I will do my best to fix it in the best way for you.\r\n\r\nThank you very much for ordering and supporting artisans&#39; small businesses. \r\nBest wishes, Manuela",
"digital_sale_message": null,
