"description": "This piece entitled &quot;Soulful Terrain&quot; is handmade from hard maple, maple veneer, brass, steel and aluminum. Treated with a process I call wood tattooing because of the appearance of the end result. Not so much the process. As with all my pieces, I do not strive for perfection. I strive for honesty. Truth. Much like the people in our lives and ourselves. No one is perfect. Accepting the imperfections is what makes everyone and everything beautiful in its own way. \n\nThis piece will bring this same feeling to your home, office or studio. Wherever you live. Wherever you create. \n\nThanks for looking! Have a great day!\nPB",
